import Rabbit from '../images/icons/rabbit.png'

function Housing() {
    return (
      <div className="housing-container">
        <div className="housing-column">
            <img src={Rabbit} alt="rabbit" />
            <h3>Free roam</h3>
        </div>
        <div className="housing-column">
            <img src={Rabbit} alt="rabbit" />
            <h3>Play pen</h3>
        </div>
      </div>
    );
  }

  export default Housing;
